import React from 'react';

class Node extends React.Component{

    render(){
        console.log(this.props);
        return (
            <div className="treeview-colorful w-20 border border-secondary mx-4 my-4">
                <ul className="treeview-colorful-list mb-3">
                    <li className="treeview-colorful-items">
                        <a className="treeview-colorful-items-header">
                            <i className="fas fa-plus-circle"></i>
                                <span><i className="far fa-envelope-open ic-w mx-1"></i>{this.props.headNode}</span>
                        </a>
                    </li>
                </ul>
            </div>

        )
    }

}

export default Node;
